import React from "react";
import './todoFom.css'

function TodoForm() {
    return (
        <form>
            <input type={Text}
            placeholder='Crea un nuevo ToDo' ></input>
            <div>
            <button className="button btn__form">Cancelar</button>
            <button className="button btn__form">Crear</button>
            </div>
        </form>
    )
};

export { TodoForm };
